description:
Purely Physical (Billy Thornberg / DvdRip / Classic / 1982)

College student and aspiring writer Kathy takes a job working as a night clerk at a busy motel in order to make money to pay for her tuition. A motley assortment of folks from various walks of life check into the motel for all kinds of carnal activities. This in turn gives Kathy ample fodder for her creative writing.

Laura Lazare, Sidney Fellows, Albert Johnson

Classic, Feature

